import TextareaAutosize from '@material-ui/core/TextareaAutosize';


const dummy={
    isLoggedIn:true,
}
const Home = () =>{
    return(
        <> 
            {dummy.isLoggedIn && 
            <form encType="multipart/form-data">
                <TextareaAutosize aria-label="" 
                rowsMin={9} style={{width:800}} placeholder="오늘 하루는 어땠나요?" />     
                
                
                
                
                
            </form>}
        </>
    )
}

export default Home;
